import React, { Component } from 'react';
import * as firebase from 'firebase';
import StudentDetails from './StudentDetails';
import ViewCompany from './ViewCompany';
import ViewJobs from './ViewJobs';
import{
    BrowserRouter as Router,
    Route,
    Link
    }from 'react-router-dom';

class LeftPanelStudents extends Component {

    constructor() {
        super();
        this.state = {
            user: null
        }
    }


    StudentDetails() {
        this.props.push('/StudentDetails');
    }

    ViewCompany() {
        this.props.push('/ViewCompany');
    }

    ViewJobs() {
        this.props.push('/ViewJobs');
    }

    render() {
        return (
            <Router>
                <div>
                    {this.state.user}
                    <div>
                        <h1> Student </h1>
                        <h2>{this.state.user}</h2>
                        <p><Link className='link' to='/StudentDetails' > Student Details </Link></p>
                        <p><Link className='link' to='/ViewCompany'>ViewCompany</Link></p>
                        <p><Link className='link' to='/ViewJobs'>ViewJobs</Link> </p>
                    </div>

                    <Route path='/StudentDetails' Component={StudentDetails} />
                    <Route path='/ViewCompany' Component={ViewCompany} />
                    <Route path='/ViewJobs' Component={ViewJobs} />


                </div>

            </Router>
        )
    }
}
export default LeftPanelStudents;
